import React, { useState } from 'react';
import ShoeInputForm from '../pages/ShoeInputForm';

const ShoeTracker = () => {
  const [shoes, setShoes] = useState([]);

  const handleAddShoe = (newShoe) => {
    setShoes([...shoes, newShoe]);
  };

  return (
    <div>
      <h2>is it time for some new shoes?</h2>
      <h2>current shoe:</h2>
      <ul>
        {shoes.map((shoe, index) => (
          <li key={index}>
            {shoe.name} (Acquired on: {shoe.acquisitionDate})
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ShoeTracker;
